        "vaeua-gui-eua.sas.van.ReportReview.LongRunningQueries.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Supprimez les objets dont le chargement est long pour éliminer les problèmes suivants. Par exemple, pour éliminer les problèmes de priorité élevée, supprimez les objets de votre rapport dont le chargement prend plus de 19 secondes.</p><p class\\="xis-paragraph">Priorité basse \\: prend &gt;\\= 3 secondes</p><p class\\="xis-paragraph">Priorité moyenne \\: prend &gt;\\= 7 secondes</p><p class\\="xis-paragraph">Priorité élevée \\: prend &gt;\\= 20 secondes</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.markovBlanket.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tente de créer une couverture de Markov autour de la variable de réponse. La couverture de Markov d’un nœud est le sous-ensemble minimal des autres nœuds requis pour prédire son comportement. Cette structure de réseau ignore les options de présélection et de sélection de variable.</p></section>',
