        "vaeua-gui-eua.partitions.useUniqueID.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Les partitions déterministes sont des partitions créées de façon identique dans les différentes sessions. Lorsque vous créez des partitions déterministes, vous vous assurez que les affectations de partition sont identiques entre les sessions. Par conséquent, les résultats qui reposent sur le partitionnement sont reproductibles.</p></section>',
