        "vaeua-gui-eua.CalculatedItemUIMediator.scopes.scopedAggregation.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Les mesures agrégées peuvent avoir de multiples périmètres. Chaque périmètre contient une expression et une intersection de catégories qui détermine l’endroit où les résultats de l’expression sont affichés dans un objet.</p><p class\\="xis-paragraph">Un périmètre par défaut contient l’expression de base dont les résultats sont affichés pour toute intersection non mentionnée dans d’autres périmètres que vous créez. Le périmètre pour cette expression de base ne peut être ni modifié ni supprimé.</p><p class\\="xis-paragraph">Outre le périmètre de l’expression de base par défaut, vous pouvez créer des périmètres personnalisés qui peuvent être modifiés et supprimés.</p></section>',
