        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.networkStructure.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Spécifie le type de structure du réseau. La structure <span class\\="xis-windowItem">Hiérarchique</span> utilise un élément de données de hiérarchie pour créer le réseau. La structure <span class\\="xis-windowItem">Dissocié</span> utilise une source et une cible. Un nœud est créé pour chaque valeur de l’élément de données source et un lien est créé à partir de chaque nœud vers le nœud qui correspond à la valeur de l’élément de données cible.</p></section>',
