        "vaeua-gui-eua.sas.van.Insights.outliers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">L’option de recherche de <span class\\="xis-windowItem">Valeurs hors normes</span> identifie les éléments de données de votre rapport susceptibles d’être affectés par des valeurs hors normes. </p><p class\\="xis-paragraph">Pour afficher une analyse des valeurs hors normes d’une mesure, cliquez sur <span data-icon-name\\="information" alt\\="l’icône Informations" aria-label\\="l’icône Informations"></span> à côté de la mesure, puis cliquez sur <span class\\="xis-windowItem">Afficher l’analyse des valeurs hors normes</span> dans la fenêtre contextuelle.</p><p class\\="xis-paragraph">Pour afficher les effets des valeurs hors normes sur les objets de votre rapport, cliquez sur <span class\\="xis-windowItem">Analyser les objets pour l’impact</span>. Lorsque l’analyse est terminée, cliquez sur <span class\\="xis-windowItem">Détails</span> à côté d’un nom d’objet pour afficher une analyse détaillée des valeurs hors normes de cet objet.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Remarque \\:</span>L’option de recherche de <span class\\="xis-windowItem">Valeurs hors normes</span> identifie toutes les valeurs hors normes dans vos sources de données, même si vos objets de rapport excluent les valeurs à l’aide de filtres ou de rangs.</div></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.LinkFunction.label.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique la fonction de liaison utilisée pour mettre en relation le modèle logistique avec la distribution de la réponse binaire.                 </p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.analyzeSentiment.help.tip.txt": "Plus d’informations sur cette option ",
