        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.reusePredictors.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Permet l’utilisation à plusieurs reprises d’un prédicteur dans les règles de découpe pour un noeud terminal. Quand cette option n’est pas sélectionnée, un prédicteur peut apparaître une fois seulement dans les règles de découpe cumulées pour un noeud terminal.</p></section>',
        "vaeua-gui-eua.Properties.assessment.showAllPlots.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Affiche tous les graphiques d’évaluation disponibles, y compris la matrice de confusion, le ROC, le lift et la mauvaise classification.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.max.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le nombre maximum de groupements qui sont affichés quand les données de la carte dépassent la limite des données système. Si les données de la carte dépassent la limite des données système, cette option est sans effet.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighReportHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Supprimez les contrôles de la zone d’invite du rapport pour éliminer le problème suivant. Par exemple, pour éliminer les problèmes de priorité moyenne, réduisez le nombre de contrôles dans la zone d’invite de page à 10 ou moins.</p><p class\\="xis-paragraph">Priorité moyenne \\: contient &gt; 10 objets dans la zone d’invite de rapport.</p></section>',
