        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.forceStrength.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Spécifie la force relative des forces locales aux forces globales lors du positionnement des noeuds et des liens. La disposition des noeuds et des liens est déterminée par un algorithme dirigé par les forces. L’algorithme recherche les positions de noeuds qui ne sont pas trop proches les unes des autres et les liens qui font à peu près la même longueur.</p><p class\\="xis-paragraph">En général, plus la valeur de <span class\\="xis-windowItem">Intensité de la force</span> est grande, plus la distance insérée entre les noeuds du réseau est grande.</p></section>',
