        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.predictorBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le nombre de classes pour les prédicteurs de mesure.</p></section>',
        "vaeua-gui-eua.Properties.recommendationsPlot.predictor.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Affiche les catégories les plus recommandées ou les moins recommandées pour chaque variable de catégorie. Vous devez attribuer au moins un prédicteur avant de pouvoir en choisir un.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.standardizationMethodlabel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique la méthode utilisée pour standardiser les prédicteurs de la mesure.</p></section>',
