        "vaeua-gui-eua.Properties.bayesNet.naive.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.splittingCriterion.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.cluster.nClusters.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Spécifie le nombre de clusters à créer ou spécifie que la méthode ABC (Aligned Box Criterion) doit être utilisée pour calculer un nombre optimal de clusters.</p><p class\\="xis-paragraph">La méthode ABC choisit d’abord un certain nombre de clusters à créer, crée les clusters et calcule la statistique d’écart pour chaque cluster. Ensuite, une distribution de référence orientée autour de chaque cluster est créée et la statistique d’écart est calculée pour chaque distribution de référence. Ce processus est répété pour tous les nombres potentiels de clusters. Le nombre de clusters qui maximise la différence totale entre les statistiques d’écart des clusters et les données de référence est choisi comme nombre optimal de clusters.</p><p class\\="xis-paragraph">La méthode ABC n’est valide que lorsque toutes les variables explicatives sont des variables de mesure.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighCustomCategoryEntries.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.neuralnetwork.l1.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utilise le nombre de prédicteurs par défaut à utiliser pour chaque division. La valeur par défaut est la racine carrée du nombre total de prédicteurs. Le nombre de prédicteurs à utiliser peut être indiqué pour chaque division.</p></section>',
        "vaeua-gui-eua.Properties.partialdependence.numBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le nombre de classes à utiliser pour discrétiser les variables de mesure dans le diagramme de Dépendance partielle.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Active l’algorithme rapide de classification des nuées dynamiques et ignore le classement. Ne sélectionnez pas cette option si vous voulez utiliser l’algorithme de recherche glouton et respecter le classement. Les réponses de mesure sans classement utilisent la variance comme critère de sélection. Quand cette option est sélectionnée, les réponses de catégorie et les réponses de mesure ayant subi un binning utilise le critère de rapport de gain. Sinon, le gain absolu est utilisé.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.linearRegression.significanceLevel.help.tip.txt": "Plus d’informations sur cette option ",
