        "vaeua-gui-eua.barSpacing.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.control.initialValueSVS.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.bayesNet.naive.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Tente de créer un réseau bayésien naïf et un réseau bayésien naïf augmenté par le réseau. Un réseau bayésien naïf spécifie que la variable de réponse est le seul parent pour tous les prédicteurs. Cela suppose une indépendance conditionnelle de tous les prédicteurs, compte tenu de la variable de réponse. Un réseau bayésien naïf augmenté étend le réseau naïf en permettant aux nœuds prédicteurs de former un réseau bayésien.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.rapidGrowth.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.bayesNet.markovBlanket.help.tip.txt": "Plus d’informations sur cette option ",
