        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.network.communityResolution.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le nombre relatif de communautés (groupements de noeuds locaux) à calculer. Les communautés sont mises à jour de façon dynamique lorsque le réseau change.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.factMac.nonnegativeFactorization.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Force les facteurs non négatifs avec des termes biais à être définis à zéro. Cela peut améliorer les performances quand les données d’apprentissage sont peu nombreuses.</p></section>',
