        "vaeua-gui-eua.sas.van.Options.capabilityLevel.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Spécifie le niveau de personnalisation que chaque utilisateur peut apporter à la vue du rapport. Chaque niveau comprend les niveaux inférieurs.</p></section>',
        "vaeua-gui-eua.sas.van.ShareDialog.embeddableLink.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Génère des balises HTML personnalisées pour que l’objet ou le rapport puisse être incorporé dans une page web.</p><p class\\="xis-paragraph">Pour activer les balises personnalisées dans votre page web, vous devez aussi ajouter des balises &lt;script&gt; à votre en-tête de page. Pour plus d’informations sur l’incorporation du contenu de SAS Visual Analytics, voir la <a href\\="https\\://developer.sas.com/sdk/va/docs/getting-started/" target\\="_blank" rel\\="noopener noreferrer">documentation SAS Visual Analytics SDK</a>.</p></section>',
        "vaeua-gui-eua.clusterSpacing.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">L’option <span class\\="xis-windowItem">Espacement des clusters</span> contrôle la largeur de l’espacement entre les clusters pour les barres groupées. Si vous voulez changer l’espace entre les barres, spécifiez l’option <span class\\="xis-windowItem">Espacement</span>.</p></section>',
        "vaeua-gui-eua.AutoCustomCategoryPanel.categoryType.help.content.txt.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Le type de groupe <span class\\="xis-windowItem">Valeurs distinctes</span> n’est disponible que pour les mesures qui comportent un nombre inférieur de valeurs uniques.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.responseBins.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le nombre de classes utilisé pour discrétiser une variable réponse continue.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.cellWeight.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruneWithValidationData.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Développe l’arbre de décision en utilisant les données d’apprentissage et élague l’arbre de décision en utilisant un algorithme de complexité des coûts appliqué aux données de validation.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.highCardinalityPredictors.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.generalizedAdditive.modelEvaluationCriterion.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le critère pour la sélection des paramètres de lissage des effets de spline.</p></section>',
        "vaeua-gui-eua.Properties.assessment.useDefaultNumberOfBins.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.bayesNet.chooseBestNumParents.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Construit les structures de réseau spécifiées, par itération sur le nombre de parents, de 1 à la valeur du nombre maximal de parents. Le réseau ayant le meilleur taux de mauvaise classification est sélectionné.</p></section>',
        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.binMethod.help.aria.txt": "Aide. Plus d’informations sur cette option ",
