        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.table.detailData.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.predAuto.sensitivityToExtremeValues.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Spécifie le degré de sensibilité utilisé pour identifier les valeurs extrêmes. Un paramètre de sensibilité élevé identifie en général plus de valeurs comme extrêmes.</p></section>',
        "vaeua-gui-eua.Properties.bayesNet.treeAugmentedNaive.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.groupingScale.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.ShareDialog.useGuestAccess.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique que les utilisateurs se connectent automatiquement avec les informations d’identification Invité, sans passer par l’écran de connexion. Pour les utilisateurs se connectant en mode invité, l’état d’affichage n’est pas conservé entre les sessions et les préférences utilisateur ne sont pas disponibles.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.maxLevels.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique la profondeur maximale de l’arbre, où le noeud racine correspond au niveau 1.</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelection.maximumEffects.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.geo.cluster.max.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.barLabelFitPolicy.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.GradientBoosting.learning_rate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le taux d’apprentissage. Un apprentissage plus lent permet d’éviter le surapprentissage du modèle.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.allowNeuronDirectConnect.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.svm.sigmoidParameterTwo.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.forest.usedefaultvariable.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.control.initialMaxValue.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique la valeur maximale initiale (limite supérieure) du contrôle. La valeur initiale est sélectionnée la première fois qu’un utilisateur ouvre le rapport, ou lorsqu’un utilisateur sélectionne <span class\\="xis-windowItem">Restaurer l’état du rapport par défaut</span>. </p><div class\\="xis-paragraph">Saisissez une valeur dans la zone de texte ou spécifiez l’un des éléments suivants&nbsp;\\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Automatique</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">indique que la sélection est enregistrée en tant que valeur initiale lorsque vous enregistrez le rapport. </p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Valeur maximale</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">spécifie que la valeur la plus élevée du contrôle est la valeur initiale.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-userSuppliedValue">nom_paramètre</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">spécifie que la valeur du paramètre que vous sélectionnez est la valeur initiale du contrôle.</p><p class\\="xis-paraSimple">Vous pouvez sélectionner un paramètre uniquement si un paramètre avec le type de données approprié existe déjà.</p></dd></dl></div>                 </div></section>',
        "vaeua-gui-eua.Properties.bayesNet.prescreenPredictors.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.react.va.geo.search.includeTraffic.help.content.txt": '<section class\\="xis-topicContent"><div class\\="xis-paragraph">Indique comment le trafic est utilisé pour calculer le temps de parcours pour l’entité graphique. Sélectionnez l’une des options suivantes \\: <div class\\="xis-listTermDef"><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Non</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Indique que le calcul du temps de parcours utilise une moyenne pondérée des données de l’historique du trafic pour toutes les heures de la journée et pour tous les jours de la semaine.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Trafic actuel</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple">Indique que le calcul du temps de parcours utilise les conditions de circulation actuelles. Ces données de trafic peuvent être actualisées en cliquant sur <span data-icon-name\\="refresh" alt\\="l’icône Mettre à jour les données de trafic" aria-label\\="l’icône Mettre à jour les données de trafic"></span>. Lorsqu’un utilisateur consulte le rapport, le trafic n’est pas mis à jour automatiquement. L’utilisateur doit mettre à jour les données de trafic pour refléter les dernières conditions de trafic.</p></dd></dl><dl class\\="xis-termDefPair"><dt class\\="xis-term"><span class\\="xis-windowItem">Trafic type</span></dt><dd class\\="xis-definition"><p class\\="xis-paraSimple"> indique que le calcul du temps de parcours utilise le trafic standard pour l’heure et le jour de la semaine spécifiés. Les conditions de trafic type sont basées sur des données historiques récentes.</p><div class\\="xis-note"><span class\\="xis-noteGenText">Remarque \\:</span> L’heure que vous indiquez est l’heure locale du lieu sur la carte.</div></dd></dl></div>                 </div><div class\\="xis-note"><span class\\="xis-noteGenText">Remarque \\:</span>L’extraction des données du temps de parcours consomme des crédits Esri Premium Services.</div><div class\\="xis-note"><span class\\="xis-noteGenText">Remarque \\:</span>Si aucune donnée de trafic n’est disponible pour la zone qui contient le calcul du temps de parcours, les limites de vitesse affichées sont utilisées pour calculer le temps de parcours.</div></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.extractNounGroups.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruning.help.aria.txt": "Aide. Plus d’informations sur cette option ",
