        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.decisionTree.pruningRegTree.help.aria.txt": "Aide. Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.splineEffect.twoWay.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Effets composés à partir de chaque paire d’éléments sélectionnés. Cet effet exige au moins deux éléments.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.SplitNodePanel.logWorth.definition.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Sélectionnez la variable à utiliser pour diviser le noeud. Les variables sont triées par logworth, qui mesure à quel point la variable scinde les données. Logworth est le log négatif de la p-value du test du chi-2.</p></section>',
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.scatterplot.overviewAxisCannotBeShown.multipleMeasurePairs.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Affiche la vue d’ensemble des axes.</p><p class\\="xis-paragraph">Cette option n’est pas disponible si plus de deux éléments de données sont affectés au diagramme.</p></section>',
