        "vaeua-gui-eua.react.va.geo.search.pinLocation.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique l’emplacement de l’épingle. Lorsque qu’un champ Emplacement vide est sélectionné, vous pouvez cliquer sur la carte pour définir l’emplacement.</p></section>',
        "vaeua-gui-eua.Properties.neuralnetwork.optimization.help.tip.txt": "Plus d’informations sur cette option ",
