        "vaeua-gui-eua.Properties.svm.defaultiteration.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utilise le nombre d’itérations maximal par défaut avant que le processus d’ajustement du modèle ne s’arrête. La valeur par défaut est 25.</p></section>',
        "vaeua-gui-eua.Properties.svm.defaulttolerance.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utilise la tolérance absolue minimale à laquelle une itération s’arrête. La valeur par défaut est 1.0E-6.</p></section>',
        "vaeua-gui-eua.sas.van.ReportReview.HighPageHeaderObjectCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Supprimez les contrôles de la zone d’invite de la page pour éliminer le problème suivant. Par exemple, pour éliminer les problèmes de priorité moyenne, réduisez le nombre de contrôles dans la zone d’invite de page à 10 ou moins.</p><p class\\="xis-paragraph">Priorité moyenne \\: contient &gt; 10 objets dans la zone d’invite de page.</p></section>',
