        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.cluster.color.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Colore les clusters sur la base des valeurs de données dans le cluster. Si le rôle de données <span class\\="xis-windowItem">Couleur</span> n’est pas affecté, cette option est sans effet.</p></section>',
