        "vaeua-gui-eua.sas.van.ReportReview.HighCalculationCount.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Supprimez les calculs pour éliminer le problème suivant. Par exemple, pour éliminer les problèmes de priorité basse, réduisez le nombre de calculs dans votre rapport à 14 ou moins.</p><p class\\="xis-paragraph">Priorité basse \\: contient &gt;\\= 15 calculs</p></section>',
