        "vaeua-gui-eua.Properties.bayesNet.variableSelection.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Teste chaque prédicteur pour l’indépendance conditionnelle de la variable de réponse donnée à tout autre prédicteur, dans le cadre de la statistique du test d’indépendance spécifié. Si vous sélectionnez <span class\\="xis-windowItem">Sélection de variables</span>, les prédicteurs qui sont conditionnellement indépendants de la variable de réponse seront rejetés quel que soit l’autre prédicteur.</p></section>',
