        "vaeua-gui-eua.Properties.assessment.cutoff.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Indique le seuil de probabilité de prédiction qui détermine si une observation est un événement modélisé.</p></section>',
        "vaeua-gui-eua.sas.van.pageVisibility.hideLinks.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.ReportReview.NestedContainers.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Ajustez la présentation de votre rapport pour éviter les conteneurs imbriqués et éliminer les problèmes suivants. Par exemple, pour éliminer les problèmes de priorité élevée, assurez-vous qu’il y a 6 conteneurs imbriqués ou moins dans votre présentation de rapport.</p><p class\\="xis-paragraph">Priorité basse \\: contient &gt; 2 conteneurs imbriqués</p><p class\\="xis-paragraph">Priorité moyenne \\: contient &gt; 4 conteneurs imbriqués</p><p class\\="xis-paragraph">Priorité élevée \\: contient &gt; 6 conteneurs imbriqués</p></section>',
