        "vaeua-gui-eua.Properties.neuralnetwork.annealingRate.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Spécifie le taux de fusion d’arrière-plan à utiliser pour l’optimisation SGD. Une valeur différente de zéro aide le modèle à converger vers le minimum local de la fonction objective.</p></section>',
