        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.includePartsOfSpeech.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Détermine si les termes sont classés par rôle d’utilisation d’une partie du discours. Par exemple, le terme “talk” peut être un verbe, comme dans “She talks”. Il peut aussi s’agir d’un nom, comme dans “She attended the talk”.</p></section>',
