        "vaeua-gui-eua.Properties.neuralnetwork.maximumIterations.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Utilise le nombre d’itérations par défaut pour l’apprentissage du réseau neuronal. La valeur par défaut est 250.</p></section>',
        "vaeua-gui-eua.Properties.linearRegression.variableSelectionType.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.Properties.predAuto.numGroups.help.tip.txt": "Plus d’informations sur cette option ",
        "vaeua-gui-eua.sas.van.views.layout.panels.Properties.textAnalytics.termWeight.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Gère la façon dont les termes sont pondérés. Le poids du terme est un nombre positif affecté à chaque terme en fonction de la distribution de ce terme dans la collection de documents. Ce poids peut être interprété comme une indication de l’importance de ce terme pour la collection de documents.</p></section>',
        "vaeua-gui-eua.react.sas.van.views.layout.panels.Properties.geo.region.placeholders.help.content.txt": '<section class\\="xis-topicContent"><p class\\="xis-paragraph">Affiche des régions supplémentaires qui ne sont pas représentées dans les données.</p></section>',
